import { Card, CardContent } from "@/components/ui/card";

interface Repo {
  id: number;
  name: string;
  html_url: string;
  description: string;
}

interface Props {
  repos: Repo[];
}

export default function RepoList({ repos }: Props) {
  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mt-4">
      {repos.map((repo) => (
        <Card key={repo.id}>
          <CardContent className="p-4">
            <a href={repo.html_url} target="_blank" rel="noopener noreferrer" className="font-semibold text-blue-600">
              {repo.name}
            </a>
            <p className="text-sm text-gray-600">{repo.description}</p>
          </CardContent>
        </Card>
      ))}
    </div>
  );
}
